script: |
  super -f text -I q9204.spq | sort > q9204.out

inputs:
  - name: q9204.spq
    data: |
      SELECT DISTINCT col1 * + 53 AS col0 FROM tab0 (FORMAT parquet) WHERE NULL BETWEEN col2 AND NULL OR NOT ( NOT ( NOT ( + 87 * + col1 ) IS NULL ) );
  - name: tab0

outputs:
  - name: q9204.out
    data: |
      1113
      4293
      53
